<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title> Physics Solver </title>
    <link rel="stylesheet" href="style.css"></link>
  </head>
  <body>
    <div id="object1">
    <h2 style="text-align: center;"> Object 1 </h2>
    <input type="text" class="property" id="mass"> Mass (Kg) </input><br>
    <input type="text" class="property" id="volume"> Volume </input><br>
    <input type="text" class="property" id="density"> Density </input><br>
    <input type="text" class="property" id="distanceX"> Distance X </input><br>
    <input type="text" class="property" id="velocityXi"> Initial Velocity X </input><br>
    <input type="text" class="property" id="velocityXf"> Final Velocity X </input><br>
    <input type="text" class="property" id="velocityXa"> Average Velocity X </input><br>
    <input type="text" class="property" id="accelerationX"> Acceleration X </input><br>
    <input type="text" class="property" id="forceTotalX"> Force Total X </input><br>
    <button id="solve1"> Solve </button><br><br>
    </div>
    <input type="text" class="global" id="time"> time (s) </input>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/2.1.3/jquery.min.js"></script>
    <!-- <script src="https://www.desmos.com/api/v1.0/calculator.js?apiKey=dcb31709b452b1cf9dc26972add0fda6"></script> -->
    <script src="index.js"></script>
    <!-- <script src="solver.js"></script> -->
    <script src="jsfucktest.js"></script>
  </body>
</html>
